import { AppBar, Toolbar, Typography } from "@mui/material";
import React from "react";
import { useStyles } from "./style";


const Header = (props)=>{

  const s = useStyles()

  return(
    <AppBar className={s.headerBar}> 
      <Toolbar>
        <Typography className={s.logo} fontSize={25}>neeva</Typography>
        <div className={s.menu}> 
          <Typography className={s.itemMenu}>Sing In</Typography>
          <Typography className={s.itemMenu} marginLeft={1}>Features</Typography>
          <Typography className={s.itemMenu} marginLeft={1}>FAQ</Typography>
          <Typography className={s.itemMenu} marginLeft={1}>Blog</Typography>
          <Typography className={s.itemMenu} marginLeft={1}>Press</Typography>
          <Typography className={s.itemMenu} marginLeft={1}>About</Typography>
        </div>

      </Toolbar>
    </AppBar>
  )
}

export default Header;
